import React from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Box,
  IconButton,
  Badge,
  Button,
} from "@mui/material";
import { ShoppingCart } from "@mui/icons-material";

export default function Navbar() {
  return (
    <AppBar
      position="static"
      sx={{ backgroundColor: "white", color: "black", boxShadow: "none" }}
    >
      <Toolbar sx={{ justifyContent: "space-between" }}>
        {/* Left: Logo */}
        <Typography variant="h6" fontWeight="bold">
          EVENTCHAMP
        </Typography>

        {/* Right: Cart + Auth */}
        <Box sx={{ display: "flex", alignItems: "center", gap: 2 }}>
          <IconButton>
            <Badge badgeContent={2} color="main">
              <ShoppingCart />
            </Badge>
          </IconButton>
          <Button variant="outlined" sx={{ borderRadius: 5 }}>
            Sign In
          </Button>
          <Button
            variant="contained"
            sx={{ borderRadius: 5, backgroundColor: "blueviolet" }}
          >
            Sign Up
          </Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}
